import React, {useState, useEffect} from 'react'
import { DataGrid } from '@mui/x-data-grid';

const columns = [
    {field: 'cryptomoeda', headerName: 'Moeda'},
    {field: 'tipo', headerName: 'Operação'},
    {field: ''}
]
const DataTable = () => {
    const [tableData, setTableData] = useState([])

    useEffect(() => {
        fetch("http://localhost:8000/api/finance/")
            .then((data) => data.json())
            .then((data) => setTableData(data))
    })

    return(
        <div style={{height: 700, width: '90%'}}>
            <DataGrid
                rows={tableData}
                columns={columns}
                pageSize={10}
            />
        </div>
    )
}

export default DataTable
